import { Button, Card } from "@material-ui/core";

import Books from "./Books";

// npm add @material-ui/core

function App() {
  return (
    <div className="App">
      <Books/>

      <Card>
        <CardHeader
          title="Hello World"
          subheader="I'm free again"
        />
      </Card>

      <Button variant="contained">My first Button!</Button>
    </div>
  );
}

export default App;
